import {FETCH_USERS} from "../action-types";

const INITIAL_STATE = {
    users:[]
};

const usersReducer = (state=INITIAL_STATE,action)=>{
  switch (action.type) {
      case FETCH_USERS:
          return {
              ...state,
              users: action.payload
          };
      default:
          return state;
  }
};

export default usersReducer;
